        public static async Task SeedUserRoles(RoleManager<IdentityRole> roleManager)
        {

            if (roleManager.Roles.All(r => r.Name != "Admin"))
            {
                await roleManager.CreateAsync(new IdentityRole { Name = "Admin" });
            }

            if (roleManager.Roles.All(r => r.Name != "Moderador"))
            {
                await roleManager.CreateAsync(new IdentityRole { Name = "Moderador" });
            }


        }

