        public static async Task SeedSampleDataAsync(ApplicationDbContext context, UserManager<AppUser> userManager)
        {
            Category libros;
            Category herramientas;
            Category ropa;
            Category electrodomesticos;
            if (!context.Categories.Any())
            {
                libros = new Category
                {
                    Name = "Libros",
                    Description = "Los mejores libros"
                };
                herramientas = new Category
                {
                    Name = "Herramientas",
                    Description = "Herramientas para todo tipo de trabajo"
                };
                ropa = new Category
